        const [ Addfheader , setAddfheader ] = useState({})
        const [ img , setimg ] = useState({})

        const Addh = async (e)=>{

                const id = Addfheader.id;
                const fheader = Addfheader.mainfheader;
                const name = Addfheader.name;
                const link1 = Addfheader.link1;
                const link2 = Addfheader.link2;
                const photo = Addfheader.image;
                console.log('ffffff',photo); 

                const response = await fetch(`${Baseurl}/add-fheader`, {
                    method: 'POST',
                headers: { 'Content-Type': 'application/json'},
                body: JSON.stringify({id , fheader, photo , name ,link1 , link2 })
                });
                console.log("okkkk",response);

        };

        const fheader=(e)=>{
                setAddfheader(Addfheader=> ({...Addfheader,[e.target.name]: e.target.value }))
                console.log('Addcompany',Addfheader);   
        };


        const convertToBase64 = (file) => {
                return new Promise((resolve, reject) => {
                  const fileReader = new FileReader();
                  fileReader.readAsDataURL(file);
                  fileReader.onload = () => {
                    resolve(fileReader.result);
                  };
                  fileReader.onerror = (error) => {
                    reject(error);
                  };
                });
              };

        const Image = async (e) => {
                const file = e.target.files[0];
                const base64 = await convertToBase64(file);
            console.log("okkkkk",base64);
          setimg(base64)
          console.log(file.name,"done");
              };
    return(
        <>
         <Header/>
